import React, { useState } from 'react'
import './App.css'



export default function App() {
  const [count, setCount] = useState(0);

  function handleClick(){
    setCount(p=>p=p+1);
    setCount(count+1);
  }
  return (
    <div className='App'>
      <h1>Count: {count}</h1>
      <button onClick={handleClick}>Up</button>
    </div>
  );
}
